<ezauthor><authors><author id="0" name="Greg McAvoy-Jensen" email="admin@myportal.com"/></authors></ezauthor>
',
      'data_type_string' => 'ezauthor',
      'id' => '700',
      'language_code' => 'eng-US',
      'language_id' => '2',
