      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Approval workflow for the front-end user self-registration</paragraph><paragraph>Useful when you wish to control who logs on to your system</paragraph></section>',
