    ),
    721 => 
    array (
      'attribute_original_id' => '0',
      'contentclassattribute_id' => '187',
      'contentobject_id' => '148',
      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<?xml version="1.0"?>
<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph>eZ Publish 4.5 supports a new publishing method used in an environment with a large simultaneous load on the database</paragraph><paragraph><ul><li><paragraph>offers a robust multi-editor environment with parallel publishing</paragraph></li><li><paragraph>controls the number of objects that can be published concurrently</paragraph></li><li><paragraph>sends publishing requests to a queue for asynchronous publishing </paragraph></li><li><paragraph>a daemon handles the publishing requests and the queue in the background </paragraph></li><li><paragraph>for multiple databases</paragraph></li><li><paragraph>better database error handling</paragraph></li><li><paragraph>filtering hooks</paragraph></li></ul></paragraph><paragraph><table width="100%"><tr><td><paragraph>The process:</paragraph><paragraph><ul><li><paragraph>Press "Send for publishing"</paragraph></li><li><paragraph>The request to publish is queued</paragraph></li><li><paragraph>This queue is monitored by the daemon&amp;nbsp;</paragraph></li><li><paragraph>Follow the status of the publishing</paragraph></li></ul></paragraph><paragraph>Queue statuses:</paragraph><paragraph><strong>Pending:</strong> The publishing request is now in a queue of publishing requests</paragraph><paragraph><strong>Working:</strong> The request is processed to find a queue and a place in the queue</paragraph><paragraph><strong>Published:</strong> The request has been processed and the object published</paragraph><paragraph>Irregularities prompts error messages</paragraph></td><td/></tr></table></paragraph><paragraph><embed align="center" size="large" object_id="149"/></paragraph><paragraph>Enable the service in &#x201C;content.ini&#x201D;:</paragraph><paragraph><literal>[PublishingSettings]
      # Enable/Disable the asynchronous publishing feature
      AsynchronousPublishing=enabled
      </literal></paragraph><paragraph>Customize the queue size in &#x201C;content.ini&#x201D;:</paragraph><paragraph><literal>[PublishingSettings]
      # how many parallel publishing operations should be allowed
      # default: 10
      PublishingProcessSlots=10
      </literal></paragraph><paragraph>Setting up the service with an init script (recommended in a production setting):</paragraph><paragraph>- For Red Hat Enterprise Linux, CentOS, Fedora, SUSE:</paragraph><paragraph><literal>bin/startup/rhel/ezasynchronouspublisher
      </literal></paragraph><paragraph>- For Debian and Ubuntu:</paragraph><paragraph><literal>bin/startup/debian/ezasynchronouspublisher
      </literal></paragraph><paragraph>Example of script for Debian:</paragraph><paragraph><literal>cd /etc/init.d
      ln -s /path/to/ezpublish/bin/startup/debian/ezasynchronouspublisher
      chmod +x ezasynchronouspublisher
      </literal></paragraph><paragraph>Start daemon:</paragraph><paragraph><literal>/etc/init.d/ezasynchronouspublisher start
      </literal></paragraph><paragraph>Daemon options:</paragraph><paragraph><literal>/etc/init.d/ezasynchronouspublisher help
      </literal></paragraph><paragraph>Configure daemon to start up on boot:</paragraph><paragraph><literal>chkconfig ezasynchronouspublisher on
      </literal></paragraph></section></section>
