      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>While there are many Content Management Systems (CMS) in the market, very few do exactly what a CMS is supposed to do: achieve a clean separation between content and design.</paragraph></section>',
