    1052 => 
    array (
      'attribute_original_id' => '0',
      'contentclassattribute_id' => '186',
      'contentobject_id' => '202',
      'data_float' => '0',
      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>To provide you with full control over your website, eZ Publish has many features that make it easy to manage both content and users.</paragraph></section>',
      'data_type_string' => 'ezxmltext',
      'id' => '1164',
      'language_code' => 'eng-US',
