      'data_int' => '1045487555',
      'data_text' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>- For simple siteaccesses, like nor, fre,, ger, eng the feature works out of the box &amp;nbsp;</paragraph><paragraph>- More complex mappings require a manual configuration in the file</paragraph><paragraph>- You use the canonical link to tell the search engines which url is the preferred one when you have several duplicate urls.</paragraph><paragraph>Example of duplicate urls:</paragraph><paragraph>-&amp;nbsp;<link target="_self" url_id="104">www.example.com</link></paragraph><paragraph>- example.com</paragraph><paragraph>-&amp;nbsp;<link target="_self" url_id="96">www.example.com/index.html</link></paragraph><paragraph>- example.com/home.asp</paragraph><paragraph>Example of canonical link:</paragraph><paragraph>&lt;link rel="canonical" href="<link target="_self" url_id="104">http://www.example.com</link>/" /&gt;</paragraph></section>',
